import React from "react";
import { ButtonGroup, Button } from "reactstrap";

function VisualizationType({ visualizationType, setVisualizationType }) {
  return (
    <div>
      <ButtonGroup>
        <Button
          onClick={() => setVisualizationType("table")}
          active={visualizationType === "table"}
        >
          Table
        </Button>
        <Button
          onClick={() => setVisualizationType("graph")}
          active={visualizationType === "graph"}
        >
          Graph
        </Button>
      </ButtonGroup>
    </div>
  );
}

export default VisualizationType;
